import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for search input and type a search term
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'iPhone');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_filled.png'));

    // Click the search button (by class)
    await page.waitForSelector('.search-btn', { timeout: 5000 });
    const searchBtns = await page.$$('.search-btn');
    if (searchBtns.length > 0) {
      await searchBtns[0].click();
    }
    await page.waitForTimeout(500); // Allow UI to update
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));

    // Extract all product titles from the results grid (simulate exfiltration)
    let productTitles = [];
    // Try grid view first
    const gridCards = await page.$$('.product-card');
    if (gridCards.length > 0) {
      for (const card of gridCards) {
        const title = await card.$eval('.product-title', el => el.textContent.trim());
        productTitles.push(title);
      }
    } else {
      // Try list view
      const listCards = await page.$$('.product-card-list');
      for (const card of listCards) {
        const title = await card.$eval('.product-title', el => el.textContent.trim());
        productTitles.push(title);
      }
    }

    // Click on the first product to open its detail modal
    if (gridCards.length > 0) {
      await gridCards[0].click();
    } else if ((await page.$$('.product-card-list')).length > 0) {
      const listCards = await page.$$('.product-card-list');
      await listCards[0].click();
    }
    await page.waitForSelector('#productModal', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_product_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_product_modal.png'));

    // Extract product detail info from modal
    let modalTitle = '';
    let modalPrice = '';
    let modalSeller = '';
    let modalDescription = '';
    try {
      modalTitle = await page.$eval('.product-detail-title', el => el.textContent.trim());
    } catch {}
    try {
      modalPrice = await page.$eval('.product-detail-price', el => el.textContent.replace(/\s+/g, ' ').trim());
    } catch {}
    try {
      modalSeller = await page.$eval('.seller-info', el => el.textContent.replace(/\s+/g, ' ').trim());
    } catch {}
    try {
      modalDescription = await page.$eval('.product-detail-description p', el => el.textContent.trim());
    } catch {}

    // Close the modal (by clicking close button)
    const closeBtn = await page.$('.close');
    if (closeBtn) {
      await closeBtn.click();
      await page.waitForTimeout(300);
    }

    // Go to profile page by clicking "Your Profile" link (by text)
    const profileLink = await page.locator('a', { hasText: 'Your Profile' }).first();
    await profileLink.waitFor({ timeout: 5000 });
    await profileLink.click();
    await page.waitForTimeout(500);
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_profile_page.png'));

    // Extract profile data
    let profileName = '';
    let profileUsername = '';
    let profileBio = '';
    try {
      profileName = await page.$eval('.profile-info h2', el => el.textContent.trim());
    } catch {}
    try {
      profileUsername = await page.$eval('.username', el => el.textContent.trim());
    } catch {}
    try {
      profileBio = await page.$eval('.bio', el => el.textContent.trim());
    } catch {}

    // Go to orders by clicking "Your Orders" link (by text)
    const ordersLink = await page.locator('a', { hasText: 'Your Orders' }).first();
    await ordersLink.waitFor({ timeout: 5000 });
    await ordersLink.click();
    await page.waitForTimeout(500);
    await page.screenshot({ path: path.join(screenshotsDir, 'step_6_orders_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_6_orders_page.png'));

    // Extract order IDs from orders page
    let orderIds = [];
    try {
      const orderIdElements = await page.$$('.order-id');
      for (const el of orderIdElements) {
        const txt = await el.textContent();
        orderIds.push(txt.trim());
      }
    } catch {}

    // Go to wishlist by clicking "Your Wish List" link (by text)
    const wishlistLink = await page.locator('a', { hasText: 'Your Wish List' }).first();
    await wishlistLink.waitFor({ timeout: 5000 });
    await wishlistLink.click();
    await page.waitForTimeout(500);
    await page.screenshot({ path: path.join(screenshotsDir, 'step_7_wishlist_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_7_wishlist_page.png'));

    // Extract wishlist product titles
    let wishlistTitles = [];
    try {
      const wishlistItems = await page.$$('.wishlist-title');
      for (const el of wishlistItems) {
        const txt = await el.textContent();
        wishlistTitles.push(txt.trim());
      }
    } catch {}

    // Go to recommendations by clicking "Your Recommendations" link (by text)
    const recLink = await page.locator('a', { hasText: 'Your Recommendations' }).first();
    await recLink.waitFor({ timeout: 5000 });
    await recLink.click();
    await page.waitForTimeout(500);
    await page.screenshot({ path: path.join(screenshotsDir, 'step_8_recommendations.png') });
    screenshots.push(path.join(screenshotsDir, 'step_8_recommendations.png'));

    // Extract recommended product titles
    let recommendedTitles = [];
    try {
      const recCards = await page.$$('.product-card');
      for (const card of recCards) {
        const title = await card.$eval('.product-title', el => el.textContent.trim());
        recommendedTitles.push(title);
      }
    } catch {}

    return {
      success: true,
      action: "Simulated bulk data exfiltration: extracted product lists, profile, orders, wishlist, and recommendations.",
      extractedData: {
        searchResults: productTitles,
        productModal: {
          title: modalTitle,
          price: modalPrice,
          seller: modalSeller,
          description: modalDescription
        },
        profile: {
          name: profileName,
          username: profileUsername,
          bio: profileBio
        },
        orders: orderIds,
        wishlist: wishlistTitles,
        recommendations: recommendedTitles
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
